import React, {useState} from "react";
import {Link, Route} from "react-router-dom";
import "./TopNav.css";

import "../Typography/Typography.css";
import {TitleText, BodyText} from "../Typography/Typography.js";

export default function TopNav(props) {

    return (
        <nav className="topNav">
            <BodyText><strong>Cosmin's UI Kit</strong></BodyText>
            <ul class="topNav__menu">
                <li class="topNav__menu__item"><Link to="/components">Components</Link></li>
                <li class="topNav__menu__item"><Link to="/composition">Examples</Link></li>
            </ul>
        </nav>
    );
}
